import React from "react";
import "./Navbar.css";

export default function Navbar() {
  return (
    <div className="Nav">
      <div className="navLeft">
        <i class="fab fa-facebook"></i>
      </div>
      <div className="navCenter">c</div>
      <div className="navRight">r</div>
    </div>
  );
}
